import React from "react";
import { StatsCardStyled } from "./Statistics.styled";

const Statistics = ({ statistics, title }) => {
  // const { id, label, percentage } = statistics;
  console.log("statistics", statistics);
  return (
    <StatsCardStyled>
      {title && <h2>{title.toUpperCase()}</h2>}
      <ul>
        {statistics.map((i) => {
          return (
            <li key={i.id}>
              <p>{i.label}</p>
              <p>{i.percentage}</p>
            </li>
          );
        })}
        {/* <li>
          <p>{label}</p>
          <p>6655</p>
        </li> */}
      </ul>
    </StatsCardStyled>
  );
};
export default Statistics;
